import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Carousel from "../components/itemCards/Carousel";
import Divider from "../components/Divider";
import { useSelector } from "react-redux";

const useStyles = makeStyles({
	itemGroup: {
		margin: "60px 0",
		"& h1": {
			marginLeft: 50,
			fontFamily: "Open Sans Condensed",
			fontSize: 54,
			marginBottom: 30,
		},
	},
});

export default function Main() {
	const classes = useStyles();

	const tobaccos = useSelector((state) => state.tobacco.cards);

	const carousels = [
		{
			name: "Табак",
			id: "tobacco-carousel",
			type: tobaccos,
		},
		{
			name: "Витратники",
			id: "consumables-carousel",
			type: tobaccos,
		},
		{
			name: "Сигари",
			id: "cigarettes-carousel",
			type: tobaccos,
		},
		{
			name: "Аксесуари",
			id: "accessories-carousel",
			type: tobaccos,
		},
	];

	return (
		<div className={classes.main}>
			{carousels.map((carousel, index) => {
				return (
					<div key={index}>
						<div className={classes.itemGroup}>
							<h1>{carousel.name}</h1>
							<Carousel escalator={carousel} />
						</div>
						<Divider />
					</div>
				);
			})}
			<div className={classes.itemGroup}>
				<iframe
					src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d20587.95668805453!2d23.98160083848094!3d49.83316375210884!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x473add803265caab%3A0x5a51467a5aadaf85!2z0YPQuy4g0JLQsNGB0YvQu9GM0LrQuNCy0YHQutC-0LPQviwgMzUsINCb0YzQstC-0LIsINCb0YzQstC-0LLRgdC60LDRjyDQvtCx0LvQsNGB0YLRjCwgNzkwMDA!5e0!3m2!1sru!2sua!4v1618770994271!5m2!1sru!2sua"
					width="555"
					height="345"
					style={{ border: 0 }}
					allowFullScreen=""
					loading="lazy"
				></iframe>
			</div>
		</div>
	);
}
